### （引子）RDD典型分析：地理区隔与收入变化

.case[

**示例**：

- 圣地亚哥(San Diego)是美国南部一个大城市，占地面积超过300平方英里。 它也很富裕，截至2019年，家庭平均年收入超过85000美元，比全国平均水平高出约50%。

- 当您向南进入城市的其他区域时，一些南部地区的收入会少一些。例如用，当你往南到达的圣伊西德罗(San Ysidro)地区时（靠近墨西哥边境），家庭收入已经下降到50000-55000美元左右。你越往南走，期望家庭收入就越低。

- 但是，当我们越过边境进入墨西哥的蒂华纳(Tijuana, Mexico)时会发生什么？一旦越过边境进入墨西哥的蒂华纳(Tijuana)。 你会发现家庭收入，突然和急剧地下降到20000美元左右。

]

### 1.1 RDD直观解释：一句话理解

断点回归设计（.red[R]egression .red[D]iscontinued .red[D]esign, RDD）：

.notes[

&gt; RDD是一种用于检验**因果关系**（causal relationship）假设的分析方法([Thistlethwaite and Campbell, 1960](#bib-thistlethwaite1960))

]

---

### 1.1 RDD直观解释：复杂一点的解释

RDD主要用于如下情形([Cattaneo and Titiunik, 2021](#bib-cattaneo2021))：

.notes[

- 被研究对象（units）上可以观测到一个**运行变量**（running variable）

- 基于某些规则（rule）研究者可以给出运行变量上的一个（或若干个）**断点值**（cutoff），并据此对所有被研究对象设定**分配水平**（assignment level）：包括**处置条件**（treatment condition）和**控制条件**（control condition）。

- 在断点值以上的被研究对象将被分配**处置条件**（treatment condition），并被定义为**处置组**（treated group）；在断点值以下的被研究对象将被分配**控制条件**（control condition），并被定义为**控制组**（controlled group）

- 在满足某些**假设条件**下，断点附近处置条件分配概率的断点式变化，可以揭示出**处置条件**对**结果变量**（目标变量）的因果关系。

]


---
name: rdd-concept

### 1.2 RDD相关概念：结果变量、运行变量、混淆变量

- **结果变量（output variable）**：研究的目标变量，一般记为
`\(Y\)`

&gt; 例如，结果变量为观测到的病人是否猝死。
  
- **运行变量(Runing variable)**&lt;sup&gt;a&lt;/sup&gt;：是一个可以观测得到的变量。一方面它将决定被研究对象（units）是否被处置（treated）；另一方面它本身也会影响到结果变量。一般记为
`\(X\)`

&gt; 例如，医生测量病人的血压，如果收缩压高于135，医生会给病人开降压药，这里病人的血压就是运行变量。


- **混淆变量(Confound variable)**：是哪些不能被直接观测得到的变量，它们可能会同时影响到**运行变量**（进而干扰到马上要定义的**处置变量**）以及**结果变量**。一般记为
`\(U\)`


.footnote[

&lt;sup&gt;a&lt;/sup&gt; 也被称为分派变量（assigning variable），或者强制变量（forcing variable）

]
 
---

### 1.2 RDD相关概念：断点和处置变量


- **断点（Cutoff）**：是运行变量中的一个具体取值，根据它的取值我们可以来决定对象是否需要处置。 这一取值一般记为
`\(X=c_0\)`

&gt; 以血压为例，假定断点值设置为收缩压135。如果你的血压高于135，就应该吃药。 如果低于135，就无须吃药。

- **处置变量（Treatment variable）**： 根据运行变量和断点值的关系，定义得到的关于是否要分配处置水平的虚拟变量。一般定义为：


`$$\begin{align}
D=
  \begin{cases}
  0 \quad \text{if} \quad X&lt; c_0 \\
  1 \quad \text{if} \quad X  \geq c_0 
  \end{cases}
\end{align}$$`



&gt; 例如，给定运行变量
`\(X\)`为病人血压，断点值为
`\(c_0=135\)`，那么处置变量即为**是否用药**。具体地，所有血压值
`\(\quad X  \geq c_0\)`的病人都会进行**用药处置**，也即虚拟变量赋值
`\(D=1 \quad (\text{if} \quad X  \geq c_0)\)`；否则就**不用药**，虚拟变量赋值为0。

---

### 1.2 RDD相关概念：谱宽

- **谱宽**(Band width)：是断点值附近的一个**邻域**的区间范围的长度，一般记为
`\(h\)`，此时这个领域的区间范围定义为
`\(b \equiv [c_0-h, c_0 +h], \quad \text{and} \quad h &gt;0\)`

.case[
**示例**：

- 研究者可以任意给定运行变量（血压）的一个**谱宽**为
`\(h=10\)`，则**断点值**附近的一个**邻域**的区间范围为
`\(b \equiv [c_0-h, c_0 +h]=[135-10, 135 +10]=[125, 145]\)`

]

???

我们有理由认为，在边境线两边的家庭几乎是相同的，除了边境线。 但是，距离更远的人(比如圣地亚哥San Diego市中心vs.墨西哥境内更远的人)可能会因为边界以外的原因而有所不同。 带宽就是您愿意考虑的可比较的边境线两边附近的空间范围。距离美墨边境线各10英尺? 各1000英尺? 各80英里?

name: rdd-causality

### 1.3 RDD因果关系分析：随机控制实验

.notes[

- **随机控制实验**（Randomized controlled experiments）：也称为随机对照实验，可以通过严格控制其他影响因素的变动，而准确分析特定一个影响因素对结果变量
`\(Y\)`的作用。绝大部分自然科学研究都基于这一实验设计理念。

&gt; 

- **准自然实验**（Quasi-experiment or Natural experiment）：对于社会科学家而言，严格的随机控制实验往往无法获得或极难实施。但是在特定条件下，也还是可以得到某种“近似”（as if）随机性的数据生成机制（DGP）。

&gt; 

- **局部随机性实验**（Local randomized
experiment）：在某些情形下，全局性（global）的随机对照实验难以满足或事实，但是却可以在局部范围内（local）进行近似随机的对照实验([Hausman and Rapson, 2018](https://doi.org/10.1146/annurev-resource-121517-033306))。

]

---

### （示例）局部随机控制实验

.case[
**分数与录取案例**：

- 高校根据高考成绩划定投档线和录取线，如果某省理工类一本录取最低控制分数线为450，该省内的一所重点高校N理工类最低录取分数线为520分。

- 那么该重点高校N最低录取线（520分）附近以下，例如516-519分之间未被录取的很多学生，与略高于最低录取线，例如520-522分之间被成功录取的很多学生，这两类学生群体理论上并无明显差异。

- 那么我们就可以基于这一局部观察，设计局部随机控制性实验分析。

]

### 1.3 RDD因果关系分析：可观测事实与反事实

**可观测事实**（observed facts）：在给定研究对象某种分配条件下（例如处置条件或控制条件），可以分别得到处置组对象（treated group， **T**）和控制组对象（controlled group, **C**），就能分别观测到结果变量的表现，也即**可观测事实**。

&gt; **可观测结果**（observed outcome）：此时，处置组和控制组的结果变量容易被观测得到，分别可记为
`\([Y_i^1\mid D=1]\)`以及
`\([Y_i^0\mid D=0]\)`

**反事实**（Counterfactual）：对于.red[处置组]的研究对象，如果不给它们分配处置条件，那么它们的结果变量会是如何呢？同理，对于.red[控制组]的研究对象，如果给它们分配处置条件，那么它们的结果变量又会是如何呢？显然，这些都是假想情形，实际并未发生的事实。

&gt; **潜在结果**（Potential outcome）：此时，处置组和控制组的结果变量不能被直接观测得到，表现为**潜在结果**，我们分别可记为
`\([Y_i^0\mid D=1]\)`以及
`\([Y_i^1\mid D=0]\)`

### 1.3 RDD因果关系分析：可观测事实与反事实(not use)

- 处置组对象的结果变量的期望：

`$$\begin{align}
E(Y_i^1\mid X_i=x) &amp; \equiv 
E\left(Y_i^1\mid X_i\geq c_0\right) + E(Y_i^1 \mid X_i &lt; c_0)   \\
&amp; \equiv E\left(Y_i^1\mid D=1\right) + E(Y_i^1 \mid D=0) \\
&amp; \equiv E\left(Y^1\mid c^+\right) + E(Y^1 \mid c^-)
\end{align}$$`

- 控制组对象的结果变量的期望：

`$$\begin{align}
E(Y_i^0\mid X_i=x) &amp; \equiv 
E\left(Y_i^0\mid X_i\geq c_0\right) + E(Y_i^0 \mid X_i &lt; c_0)   \\
&amp; \equiv E\left(Y_i^0\mid D=1\right) + E(Y_i^0 \mid D=0) \\
&amp; \equiv E\left(Y^0\mid c^+\right) + E(Y^0 \mid c^-)
\end{align}$$`

- 处置变量对结果变量的因果效应：

`$$\begin{align}
\tau &amp;= E(Y_i^1\mid X_i=x)  - E(Y_i^0\mid X_i=x)  \\
&amp;= \left[ E\left(Y^1\mid c^+\right) + E(Y^1 \mid c^-) \right] -
\left[ E\left(Y^0\mid c^+\right) + E(Y^0 \mid c^-) \right]
\end{align}$$`


---

### 1.3 RDD因果关系分析：可观测事实与反事实（表达式）

- 处置条件下结果变量（可观测的和潜在的）的期望：

`$$\begin{align}
&amp; \equiv \mathbb{E}\left(Y_i^1\mid X_i\geq c_0\right) + \mathbb{E}(Y_i^0 \mid X_i \geq c_0)   \\
&amp; \equiv \mathbb{E}\left(Y_i^1\mid D=1\right) + \mathbb{E}(Y_i^0 \mid D=1) \\
&amp; \equiv \mathbb{E}\left(Y^1\mid c^+\right) + \mathbb{E}(Y^0 \mid c^+)
\end{align}$$`

- 控制条件下结果变量（可观测的和潜在的）的期望：

`$$\begin{align}
&amp; \equiv \mathbb{E}\left(Y_i^1\mid X_i &lt; c_0\right) + \mathbb{E}(Y_i^0 \mid X_i &lt; c_0)   \\
&amp; \equiv \mathbb{E}\left(Y_i^1\mid D=0\right) + \mathbb{E}(Y_i^0 \mid D=0) \\
&amp; \equiv \mathbb{E}\left(Y^1\mid c^- \right) + \mathbb{E}(Y^0 \mid c^-)
\end{align}$$`

- 处置变量对结果变量的因果效应：

`$$\begin{align}
\tau &amp;= 
\left[ \mathbb{E}\left(Y^1\mid c^+\right) + \mathbb{E}(Y^0 \mid c^+) \right] -
\left[ \mathbb{E}\left(Y^1\mid c^- \right) + \mathbb{E}(Y^0 \mid c^-) \right]
\end{align}$$`

---

### 1.3 RDD因果关系分析：断点处置效应ATE（表达式）

- 处置变量对结果变量的因果效应：

`$$\begin{align}
\tau &amp;= 
 \mathbb{E}\left(Y_i\mid X_i \geq c\right) -
\mathbb{E}\left(Y_i\mid X_i &lt; c\right)  \\ &amp;= 
 \mathbb{E}\left(Y^1_i\mid X_i \geq c\right) -
\mathbb{E}\left(Y^0_i\mid X_i &lt; c\right) \\
&amp;= 
 \mathbb{E}\left(Y^1_i\right) -
\mathbb{E}\left(Y^0_i\right)
\end{align}$$`

### 1.4 RDD基本假设：连续性假设


**假设1**：**结果变量**的期望值在**断点**处需要满足**连续性假设**（continuity assumption）：

- **结果变量**的期望值在**断点**处连续，也即
`\(E[Y_i(1)|X_i = x]\)`和
`\(E[Y_i(0)|X_i = x]\)`，可是作为
`\(x\)`的函数（
`\(f(x)\)`），且在
`\(x=c_0\)`出连续。（见下图）

- **断点**值
`\(c_0\)`本身需要满足**外生性**（exogeneity）条件。也即，**断点**值
`\(c_0\)`在触发**处置变量**D的时候，不会有**其他变量**在同时期来干预这种“触发行为”。

- 在上述条件下，运行变量
`\(X\)`对结果变量
`\(Y\)`将**不再**具有直接影响（
`\(X \rightarrow Y\)`），而是通过处置变量
`\(D\)`发生间接作用（
`\(X \rightarrow D \rightarrow Y\)`）。

- **连续性假设**（continuity assumption）应该是RDD**最关键**的一个假设条件，而且这符合**经验事实**。

&gt; .blue[**大自然不会跳跃！**&lt;sup&gt;[a]&lt;/sup&gt;  ---达尔文《物种起源》]

.footnote[

&lt;sup&gt;[a]&lt;/sup&gt; 事物的发展变化总是**渐进式**的，而不会陡然改变。常言道“量变引发质变”。

]

---

### 1.4 RDD基本假设：断点性假设

**假设2**：被研究对象被分配（assign）.red[处置条件]（treated condition）&lt;sup&gt;[1]&lt;/sup&gt;的**条件概率**（Conditional Probability of Receiving Treatment）
`\(P(D_i= 1 \mid X_i=c_0)\)`在断点处是**不连续的**（也即间断的）。

常见的处置分配概率不连续**模式**包括：

- **骤变不连续**（Sharp discontinuity）：处置条件分配的概率在断点处被完全决定。

- **模糊不连续**（Fuzzy discontinuity）：处置条件分配的概率在断点处**不能**被完全决定。

.footnote[

&lt;sup&gt;[1]&lt;/sup&gt; 回顾**分配水平**（assign level）具有两个水平：处置条件（treated condition）和控制条件（controlled condition）

]

name: ate

### 2.1 平均和断点处置效应：定义

- 当个体
`\(i\)`被分配为“处置条件”时，其结果变量为
`\(Y_1\)`为；当个体
`\(i\)`被分配为“控制条件”时，其结果变量为
`\(Y_0\)`。

- 此时，个体
`\(i\)`的**处置效应**(treatment effect)记为
`\(\theta=Y_1 -Y_0\)`，因为其具有随机性，也被称为**随机处置效应**(random treatment effect)

- 给定一个可观测的协变量
`\(X\)`（运行变量），我们可以得到个体
`\(i\)`的**条件处置效应**(conditional treatment effect)，并记为：

`$$\theta |(X=x)=(Y_1 -Y_0)|(X=x)$$`


- 对于
`\(X=x\)`处的多个个体，我们可以得到它们的条件**平均处置效应**（average treatment effect, ATE），并记为：

`$$\theta(x) \equiv \mathbb{E}(\theta \mid X=x)$$`

---

### （示例）个体和平均处置效应


&lt;img src="../pic/HANSEN21-1a-outcome.png" width="800" height="500" style="display: block; margin: auto;" /&gt;

---

### 2.1 平均和断点处置效应：条件期望函数CEF

给定结果变量的**条件期望函数**(conditional expect function, CEF)&lt;sup&gt;a&lt;/sup&gt;如下：

`$$m(x) \equiv \mathbb{E}(Y|X=x)$$`

则可以分别得到**控制条件**和**处置条件**下的**条件期望函数**：

`$$\begin{align}
  \begin{cases}
    m_0(x) = \mathbb{E}(Y_0|X=x)\\
    m_1(x) = \mathbb{E}(Y_1|X=x)
  \end{cases}
\end{align}$$`

进而，我们可以把**条件平均处置效应**(conditional ATE)表达为：

`$$\begin{align}
\theta(x) &amp;\equiv \mathbb{E}(\theta \mid X=x) \\
&amp; = \mathbb{E}[(Y_1 -Y_0) \mid X=x] \\
&amp; = \mathbb{E}[(Y_1\mid X=x ) -(Y_0\mid X=x)] \\
&amp; = m_1(x)  -m_0(x) 
\end{align}$$`

.footnote[

&lt;sup&gt;a&lt;/sup&gt; 这里先表达为**隐函数**形式，也即其具体函数表达式未知。
]

---

### （示例）条件期望函数CEF与平均处置效应

&lt;img src="../pic/HANSEN21-1a-outcome-expect.png" width="600" height="500" style="display: block; margin: auto;" /&gt;


---

### 2.1 平均和断点处置效应：CEF连续性假设

结果变量的条件期望函数在断点处的**连续性**（continuity）假设：

&gt; 给定断点值为
`\(x=c\)`，假设结果变量的条件期望函数
`\(m(x)\)`在断点处
`\(x=c\)`连续。

&gt; 这也意味着在*控制条件**和**处置条件**下的**条件期望函数**也在断点处是连续的。也即
`\(m_0(x)\)`和
`\(m_1(x)\)`在断点处
`\(x=c\)`连续。

.note[

**定义**：我们把条件函数的
**极限**（
`\(z\)`从右边向
`\(x\)`值取极限，和
`\(z\)`从左边向
`\(x\)`值取极限）定义如下

`$$\begin{align}
m(x+)&amp;=\lim_{z \downarrow x} m(z)\\
m(x-)&amp;=\lim_{z \uparrow x} m(z)
\end{align}$$`

]

---

### 2.1 平均和断点处置效应：定理

**断点处置效应**定理：给定处置分配规则为
`\(D=1\{X \geq c\}\)`，而且假定结果变量满足断点处的连续性假设，也即结果变量的条件期望函数
`\(m(x)\)`在断点处
`\(x=c\)`连续，那么**断点处置效应**为：

`$$\bar{\theta}=\lim_{z \downarrow c} m(z) - \lim_{z \uparrow c} m(z)=m(c+)-m(c-)$$`

---

### 2.1 平均和断点处置效应：证明

**证明**：首先，我们进一步定义结果变量：

`$$\begin{align}
Y \equiv Y_0 \cdot\mathbb{1}\{x&lt;c\} + Y_1 \cdot\mathbb{1}\{x\geq c\}
\end{align}$$`

两边对
`\(X=x\)`取期望，且根据结果变量的条件期望函数的定义，则有：

`$$\begin{align}
\mathbb{E}(Y|X=x) &amp;= \mathbb{E}(Y_0|X=x) \cdot\mathbb{1}\{x&lt;c\} + \mathbb{E}(Y_1|X=x) \cdot\mathbb{1}\{x\geq c\} \\ 
\Rightarrow m(x) &amp;= m_0(x)\cdot\mathbb{1}\{x&lt;c\} + m_1(x) \cdot\mathbb{1}\{x\geq c\} 
\end{align}$$`

根据前面关于**条件处置效应**的定义及**连续性假设**，则有：

.pull-left[
`$$\begin{align}
\theta(x) &amp;\equiv \mathbb{E}(\theta \mid X=x) \\
&amp; = \mathbb{E}[(Y_1 -Y_0) \mid X=x] \\
&amp; = \mathbb{E}[(Y_1\mid X=x ) -(Y_0\mid X=x)] \\
&amp; = m_1(x)  -m_0(x) 
\end{align}$$`
]

.pull-rgith[
`$$\begin{align}
\theta(c) &amp;=  m_1(c)  -m_0(c) \\
&amp;= \lim_{x\downarrow c}{m(x)} - \lim_{x\uparrow c}{m(x)}  &amp;&amp;\leftarrow \text{(连续性假设)} \\
&amp; = m(c+) - m(c-)
\end{align}$$`
]

name: sharp-est

### 2.2 骤变RDD的估计：边界估计问题

**断点回归设计**（RDD）属于典型的**边界估计**（boundary estimation）问题，这里我们将优先采用**局部线性回归**（local linear regression, LLR）方法进行估计。

&gt; 这里，我们将使用到非参数的**核函数**（kernel  function）方法来除了回归的权重问题。

给定如下条件：

- 变量集

`$$\begin{align}
Z_{i}(x)=\left(
  \begin{array}{c}
  \mathbb{1} \\
  X_{i}-x
  \end{array}
\right)
\end{align}$$`


- 核函数（kernel function）
`\(K(u)\)`

- 谱宽（bandwidth）
`\(h\)`



---

### 2.2 骤变RDD的估计：局部线性回归估计（CEF）

此时，可以证明**局部线性**方法下的系数估计为（证明略）：

- 对于断点左侧
`\(x &lt; c\)`，系数估计为&lt;sup&gt;a&lt;/sup&gt;：

`$$\begin{align}
\boldsymbol{\widehat{\beta}_{0}}(x)=\left(\sum_{i=1}^{n} K\left(\frac{X_{i}-x}{h}\right) Z_{i}(x) Z_{i}(x)^{\prime}\cdot \mathbb{1}\left\{X_{i}&lt;c\right\}\right)^{-1}\left(\sum_{i=1}^{n} K\left(\frac{X_{i}-x}{h}\right) Z_{i}(x) Y_{i}\cdot \mathbb{1}\left\{X_{i}&lt;c\right\}\right)
\end{align}$$`

- 对于断点左侧
`\(x \geq c\)`，系数估计为&lt;sup&gt;b&lt;/sup&gt;：

`$$\begin{align}
\boldsymbol{\widehat{\beta}_{1}}(x)=\left(\sum_{i=1}^{n} K\left(\frac{X_{i}-x}{h}\right) Z_{i}(x) Z_{i}(x)^{\prime} \cdot\mathbb{1}\left\{X_{i} \geq c\right\}\right)^{-1}\left(\sum_{i=1}^{n} K\left(\frac{X_{i}-x}{h}\right) Z_{i}(x) Y_{i} \cdot\mathbb{1}\left\{X_{i} \geq c\right\}\right)
\end{align}$$`

.footnote[

&lt;sup&gt;a&lt;/sup&gt; &lt;sup&gt;b&lt;/sup&gt; 需要注意的是，这里我们得到的都是系数向量（vector）。

]

---

### 2.2 骤变RDD的估计：局部线性回归估计（断点效应）

根据结果变量条件期望函数
`\(m(x)\)`的定义，我们可以使用上述系数估计
`\(\boldsymbol{\widehat{\beta}_{0}}(x),\boldsymbol{\widehat{\beta}_{1}}(x)\}\)`，进一步得到结果变量条件期望函数的估计结果&lt;sup&gt;a&lt;/sup&gt;：

`$$\begin{align}
\widehat{m}(x)=\left[\boldsymbol{\widehat{\beta}_{0}}(x)\right]_{1} \cdot  \mathbb{1}\{x&lt;c\}+\left[\boldsymbol{\widehat{\beta}_{1}}(x)\right]_{1} \cdot \mathbb{1}\{x \geq c\}
\end{align}$$`

因此，根据**断点处置效应定理**，可以得到在断点
`\(x=c\)`处对总体平均处置效应
`\(\bar{\theta}\)`的样本估计结果
`\(\hat{\theta}\)`：

`$$\begin{align}
\widehat{\theta}=\left[\boldsymbol{\widehat{\beta}_{1}}(c)\right]_{1}-\left[\boldsymbol{\widehat{\beta}_{0}}(c)\right]_{1}=\hat{m}(c+)-\widehat{m}(c-)
\end{align}$$`

.footnote[

&lt;sup&gt;a&lt;/sup&gt; 条件期望函数CEF只需要用到系数向量（vector）的第一个元素，因此用了下标&lt;sub&gt;1&lt;/sub&gt;表达。

]

---

### 2.2 骤变RDD估计：简单线性回归方法

- 容易证明**骤变RDD断点处置效应**也可以通过如下简单线性回归方法
等价地得到
`\(\widehat{\theta}\)`的对应估计值：

`$$\begin{align}
Y=\beta_{0}+\beta_{1} X+\beta_{3}(X-c) D+\theta D+e
\end{align}$$`

需要注意的是：

- 上述等价模型，只是等价前面的基于**非正规化矩形核函数**（unnormalized Rectangular）谱宽下的**局部线性LL**断点处置估计效应值。

- 简单地，上述等价模型需要进行样本数据集的重新定义。具体地，运行变量的范围需要调整到
`\(X\in [c-h^{\ast}, c+h^{\ast}]\)`，其中
`\(h^{\ast}=\sqrt{3}h=\sqrt{3}\times 8\)`

---
name: sharp-bw

### 2.3 骤变RDD谱宽选择：基本问题

.notes[

- 基于**边界估计**的**局部线性回归**方法本质上需要进行**非参数估计**，这尤其体现在核函数的**谱宽**（bandwidth）估计。

- 目前还没有达成一致意见的最优谱宽选择方法。因此在进行LLR估计之前，研究者不得不多尝试多种**数据导向**（data based）的谱宽选择工具。

- 谱宽估计是一项具有挑战性的工作，有些具体估计方法会异常复杂。

]

当然，这里可以建议使用两种谱宽选择方法：

- **多项式**(polynomial, PN)谱宽选择法([Fan, Gijbels, Hu, et al., 1996](#bib-fan1996))：这是一种经验方法。

- **交叉验证**（cross validation, CV）谱宽选择法

---

### 2.3 骤变RDD谱宽选择：多项式法

- 首先构造包含
`\(q\)`阶多项式和断点漂移项的模型：

`$$\begin{align}
m(x)=\beta_{0}+\beta_{1} x+\beta_{2} x^{2}+\cdots+\beta_{q} x^{q}+\beta_{q+1} D
\end{align}$$`

- 然后，通过估计得到的条件期望函数
`\(\widehat{m}(x)\)`计算二阶求导结果：

`$$\begin{align}
\widehat{m}^{\prime \prime}(x)=2 \widehat{\beta}_{2}+6 \widehat{\beta}_{3} x+12 \widehat{\beta}_{4} x^{2}+\cdots+q(q-1) \widehat{\beta}_{q} x^{q-2}
\end{align}$$`

- 再计算常量
`\(\overline{B}\)`，其中
`\([\xi_1, \xi_2]\)`是运行变量
`\(X\)`内部的一个评价区间：

`$$\begin{align}
\widehat{B}=\frac{1}{n} \sum_{i=1}^{n}\left(\frac{1}{2} \widehat{m}^{\prime \prime}\left(X_{i}\right)\right)^{2} \mathbb{1}\left\{\xi_{1} \leq X_{i} \leq \xi_{2}\right\}
\end{align}$$`


- 最后，对于任意**正规化核**（normalized kernel），可以计算得到**谱宽**：

`$$\begin{align}
h_{\text{FG}}=0.58 \cdot \left(\frac{\widehat{\sigma}^{2}\left(\xi_{2}-\xi_{1}\right)}{\widehat{B}}\right)^{1 / 5} n^{-1 / 5}
\end{align}$$`

---

### 2.3 骤变RDD谱宽选择：多项式法

根据核函数的不同，多项式法(polynomial)计算公式略有不同：

- 对于**非规化矩形核**（un-normalized rectangular kernel）
`\(K(u)=1/2, \text {for} |u|\leq 1\)`：

`$$\begin{align}
h_{\text{pn}}=1\cdot \left(\frac{\widehat{\sigma}^{2}\left(\xi_{2}-\xi_{1}\right)}{\widehat{B}}\right)^{1 / 5} n^{-1 / 5}
\end{align}$$`

- 对于**非规化三角核**（un-normalized rectangular kernel）
`\(K(u)=1-|u|, \text {for} |u|\leq 1\)`：

`$$\begin{align}
h_{\text{pn}}=1.42\cdot \left(\frac{\widehat{\sigma}^{2}\left(\xi_{2}-\xi_{1}\right)}{\widehat{B}}\right)^{1 / 5} n^{-1 / 5}
\end{align}$$`


---

### 2.3 骤变RDD谱宽选择：交叉验证法

.notes[

- **交叉验证**（cross validation, CV）方法：主要形式是把训练集分成两部分，一部分用来训练模型，另一部分用来验证模型。

- **交叉验证**方法包括：**留出法**（holdout）、**留一法**（Leave-one-out,
LOO）、K折法（K-fold）、**自助法**（Bootstrap）等。

- 这里介绍的**交叉验证**谱宽选择法主要采用**留一法**（Leave-one-out,LOO）。
]

**留一法**（Leave-one-out,LOO）选择谱宽的基本步骤：

- 初步选定一个临近断点的区间
`\([\xi_1, \xi_2]\)`（去中心化后centered X的范围）

- 任意选择初始谱宽

- 通过**留一法**计算模型预测残差及其**残差平方和**

- 以**最小化**残差平方和为目标，分析谱宽的变化趋势&lt;sup&gt;a&lt;/sup&gt;，并最终确定谱宽bandwidth。


.footnote[

&lt;sup&gt;a&lt;/sup&gt; 可以绘制CV标准（如均方误差AMSE）与谱宽关系的图示法进行观察。

]


---

### 2.3 骤变RDD谱宽选择：方法评析

- 谱宽估计的噪点（noise）会进入到RDD估计进程中去，因此谱宽选择显得非常重要。

- 无论是**多项式法**还是**交叉验证法**，确定最终谱宽时，都考虑到了**全局性**准确度。

.fyi[
&gt; 这意味着它们都用到了更多的样本数据，因此谱宽估计会比较稳定。
]

- 另一种**局部性**的谱宽选择方法，主要考察**断点**附近(near-by)的准确度。

.fyi[

&gt; 因为局部性存在多种可能，所以这类方法得到的谱宽会更加不稳定。具体参看([Imbens and Kalyanaraman, 2012](#bib-imbens2012c); [Arai and Ichimura, 2018](#bib-arai2018))。

]

- 通过**改变**谱宽值，来对RDD估计进行**稳健性检查**是很必要的。

.fyi[
&gt; 更大的谱宽，一般会使得断点效应估计系数**方差减小**(reduce variance)，置信区间变窄，但同时也会**增加偏误**(increase bias)。

]

---

### 2.3 骤变RDD谱宽选择：方法评析

.fyi[

谱宽选择的**经验法则**：

- 实践操作中，我们往往需要同时结合**多项式法**和**交叉验证法**来确定一个谱宽
`\(\tilde{h}\)`。

- 在上述基础上，我们还需要适当调减谱宽值，例如
`\(h = 25\%\cdot\tilde{h}\)`，以减少估计偏误。

]


---
name: sharp-refer

### 2.4 骤变RDD推断：理论估计偏误和方差

基于**局部线性回归**LLR估计结果，对断点处置效应参数
`\(\bar{\theta}\)`的推断陈述（inferential statement），都会受到其中**非参数估计**偏差的影响。

可以证明，**局部线性回归**（LLR）的估计量
`\(\hat{m}(x)\)`在**标准正则条件**（standard regularity conditions）下将服从**渐近正态分布**。

- 此时，RDD估计量
`\(\hat{\theta}\)`的渐近偏误（bias）和渐近方差分别为：

`$$\begin{align}
\operatorname{bias}[\widehat{\theta}]
&amp;=\frac{h^{2} \sigma_{K^{*}}^{2}}{2}\left(m^{\prime \prime}(c+)-m^{\prime \prime}(c-)\right)\\
\operatorname{var}[\widehat{\theta}]
&amp;=\frac{R_{K}^{*}}{n h}\left(\frac{\sigma^{2}(c+)}{f(c+)}+\frac{\sigma^{2}(c-)}{f(c-)}\right)
\end{align}$$`

---

### 2.4 骤变RDD推断：样本方差

上述理论方差，我们可以通过两个**边界回归**（断点两边）的系数估计量的**渐近方差**求和计算得到。我们首先给定如下条件：

- 变量集：

`$$\begin{align}
Z_{i}=\left(
  \begin{array}{c}
  \mathbb{1} \\
  X_{i}-c
  \end{array}
\right)
\end{align}$$`


- **核函数**（kernel function）
`\(K_i=k\left(\frac{X_i - c}{h}\right)\)`

- **谱宽**（bandwidth）
`\(h\)`

- **留一法**&lt;sup&gt;a&lt;/sup&gt;得到的模型预测**残差**（leave-one-out prediction error）
`\(\tilde{e}_i\)`

.footnote[

&lt;sup&gt;a&lt;/sup&gt; **留一法**(Leave One Out, LOO) 是一种 常见的交叉验证方法，其中每个观察集都被视为验证集test，其余的
`\((n-1)\)`观测值被视为训练集training。此处原理类似，每次都去掉一个数据进行估计，然后根据估计结果进行预测，然后得到预测误差。
]

---

### 2.4 骤变RDD推断：样本方差

此时，我们可以得到**局部线性回归**LLR估计系数
`\(\hat{\theta}\)`的**方差协方差矩阵**分别为：

`$$\begin{aligned}
&amp;\widehat{\boldsymbol{V}}_{0}=\left(\sum_{i=1}^{n} K_{i} Z_{i} Z_{i}^{\prime} \cdot  \mathbb{1}\left\{X_{i}&lt;c\right\}\right)^{-1}\left(\sum_{i=1}^{n} K_{i}^{2} Z_{i} Z_{i}^{\prime} \tilde{e}_{i}^{2} \cdot  \mathbb{1}\left\{X_{i}&lt;c\right\}\right)\left(\sum_{i=1}^{n} K_{i} Z_{i} Z_{i}^{\prime} \cdot  \mathbb{1}\left\{X_{i}&lt;c\right\}\right)^{-1} \\
&amp;\widehat{\boldsymbol{V}}_{1}=\left(\sum_{i=1}^{n} K_{i} Z_{i} Z_{i}^{\prime} \cdot  \mathbb{1}\left\{X_{i} \geq c\right\}\right)^{-1}\left(\sum_{i=1}^{n} K_{i}^{2} Z_{i} Z_{i}^{\prime} \tilde{\boldsymbol{e}}_{i}^{2} \cdot  \mathbb{1}\left\{X_{i} \geq c\right\}\right)\left(\sum_{i=1}^{n} K_{i} Z_{i} Z_{i}^{\prime} \cdot \mathbb{1}\left\{X_{i} \geq c\right\}\right)^{-1}
\end{aligned}$$`

进一步地，估计系数
`\(\hat{\theta}\)`的渐进方差为上述两个矩阵第一个对角元素之和：

`$$\text{Var}{(\hat{\theta})}=\left[\widehat{\boldsymbol{V}}_{0}\right]_{11}+\left[\widehat{\boldsymbol{V}}_{1}\right]_{11}$$`

---

### 2.4 骤变RDD推断：置信区间和置信带

最后，我们可以分别对断点两侧计算**逐点置信区间**（Pointwise Conﬁdence Interval），并相应构建**置信带**。

`$$\begin{align}
\widehat{m}(x) \pm z_{1-\alpha/2}(n-1) \cdot \sqrt{\widehat{V}_{\widehat{m}(x)}}\\
\widehat{m}(x) \pm 1.96 \sqrt{\widehat{V}_{\widehat{m}(x)}}
\end{align}$$`

### （死亡率案例）背景说明1/2


.case[

**援助项目与儿童死亡率**：

- 案例基于([Ludwig and Miller, 2007](#bib-ludwig2007))的研究，他们重点评估了美国联邦政府脱贫援助项目（Head Start）的**骤变RDD**政策效应。

- 该援助项目于1965年实施，为3-5岁贫困孩子及其家庭提供学前教育、健康和社会服务等方面的资金援助。对于该援助项目经费，联邦政府将决定通过公开竞标，分配给提交援助申请的中标县。

- 为了保障援助项目的针对性，联邦政府将重点考虑资助被认定的300个贫困县。其中**贫困县**是基于1960年美国统计测度得到的**贫困线水平**（poverty rate）予以划定。

- 最终，300个贫困县中，有80%的县获得了项目资助；而其他提交申请的县中（非贫困县），有43%的县也获得了项目资助。

]

.case[

**援助项目与儿童死亡率**(续)：
- ([Ludwig and Miller, 2007](#bib-ludwig2007))重点关注**援助项目**对中长期**儿童死亡率**影响。其中儿童死亡率定义为：1973-1983年间、儿童年龄范围在8-18岁、儿童死亡原因为Head Start定义的相关原因（如结核病等）。因而而援助项目希望努力消减这些儿童死亡情形的发生。

- 我们关注的问题：**脱贫援助项目**（Head Start）对**儿童死亡率**（`Y=mortality rate`）的因果效应。我们将采用骤变RDD非参数回归估计，**运行变量**为县贫困率（`X=poverty rate`），**断点值**(cut-off)设定为
`\(c=59.1984\)`。将使用**子样本数据**的样本数为n=2783。

]

### （死亡率案例）CEF方差估计：计算方差、标准差

- 直接使用谱宽&lt;sup&gt;a&lt;/sup&gt;
`\(h=8\)`进行局部线性LL估计，并利用**留一法**法计算得到**预测误差**
`\(\tilde{\boldsymbol{e}}\)`，并最终分别得断点两侧的协方差矩阵（见下式），从而进一步计算得到CEF估计值的方差和标准差（见后面附表）。

`$$\begin{aligned}
&amp;\widehat{\boldsymbol{V}}_{0}=\left(\sum_{i=1}^{n} K_{i} Z_{i} Z_{i}^{\prime} \cdot  \mathbb{1}\left\{X_{i}&lt;c\right\}\right)^{-1}\left(\sum_{i=1}^{n} K_{i}^{2} Z_{i} Z_{i}^{\prime} \tilde{e}_{i}^{2} \cdot  \mathbb{1}\left\{X_{i}&lt;c\right\}\right)\left(\sum_{i=1}^{n} K_{i} Z_{i} Z_{i}^{\prime} \cdot  \mathbb{1}\left\{X_{i}&lt;c\right\}\right)^{-1} \\
&amp;\widehat{\boldsymbol{V}}_{1}=\left(\sum_{i=1}^{n} K_{i} Z_{i} Z_{i}^{\prime} \cdot  \mathbb{1}\left\{X_{i} \geq c\right\}\right)^{-1}\left(\sum_{i=1}^{n} K_{i}^{2} Z_{i} Z_{i}^{\prime} \tilde{\boldsymbol{e}}_{i}^{2} \cdot  \mathbb{1}\left\{X_{i} \geq c\right\}\right)\left(\sum_{i=1}^{n} K_{i} Z_{i} Z_{i}^{\prime} \cdot \mathbb{1}\left\{X_{i} \geq c\right\}\right)^{-1}
\end{aligned}$$`


.footnote[

&lt;sup&gt;a&lt;/sup&gt; 这里我们没有再次评估条件方差估计中的最优谱宽，而是简单直接地使用了CEF估计时的谱宽。但是我们还是要注意，二者的最优谱宽可以完全不相同！

]

### （死亡率案例）CEF的置信区间和置信带

- 进一步计算**局部线性估计**下的**逐点置信区间**（Pointwise Conﬁdence Interval）（见后面附表），并得到置信带（见后面附图）。

`$$\begin{align}
\widehat{m}(x) \pm z_{1-\alpha/2}(n-1) \cdot \sqrt{\widehat{V}_{\widehat{m}(x)}}\\
\widehat{m}(x) \pm 1.96 \sqrt{\widehat{V}_{\widehat{m}(x)}}
\end{align}$$`

### （死亡率案例）RDD断点处置效应：计算结果

- 根据**断点处置效应定理**，可以得到在断点
`\(x=c=59.1984\)`处对总体平均处置效应
`\(\bar{\theta}\)`的样本估计结果
`\(\hat{\theta}\)`：

`$$\begin{align}
\widehat{\theta}
&amp;=\left[\boldsymbol{\widehat{\beta}_{1}}(c)\right]_{1}-\left[\boldsymbol{\widehat{\beta}_{0}}(c)\right]_{1}\\
&amp;=\hat{m}(c+)-\widehat{m}(c-)\\
&amp;=3.3096
-1.8035
=-1.5060
\end{align}$$`



- 断点处置效应估计值为
`\(\hat{\theta}=-1.5060\)`。

.small[
&gt; 
- 断点左边的条件期望(CEF)的估计值
`\(\widehat{m}(c-)=3.31\)`；
- 断点右边的条件期望(CEF)的估计值
`\(\widehat{m}(c+)=1.8\)`；

]

- **结论**：援助项目的实施，减低了儿童死亡率，使得10万个孩子中约1.51个小孩免于遭受死亡。相比不实施项目援助，儿童死亡率由3.3096，下降到1.8035，降幅接近50%。

### （死亡率案例）RDD断点处置效应：估计误差及显著性检验

- 进一步地，估计系数
`\(\hat{\theta}\)`的**渐进方差**为两个方差协方差矩阵第一个对角元素之和：

`$$\begin{align}
\text{Var}{(\hat{\theta})}
&amp;=\left[\widehat{\boldsymbol{V}}_{0}\right]_{11}+\left[\widehat{\boldsymbol{V}}_{1}\right]_{11}\\
&amp;= 0.3673 + 0.1417
= 0.5090\\
se({(\hat{\theta})}) &amp;= \sqrt{\text{Var}{(\hat{\theta})}}
= \sqrt{0.5090}
=0.7134
\end{align}$$`

.small[
&gt; 
- 断点左边的条件期望(CEF)的估计值
`\(\widehat{m}(c-)=3.3096\)`；
- 断点右边的条件期望(CEF)的估计值
`\(\widehat{m}(c+)=1.8035\)`；

]

- **结论**：援助项目的实施，减低了儿童死亡率，使得10万个孩子中约-1.5060个小孩免于遭受死亡。相比不实施项目援助，儿童死亡率由3.3096，下降到1.8035，降幅接近50%。

### （死亡率案例）等价线性回归：调整运行变量范围

- 如前所述，**骤变RDD断点处置效应**也可以通过如下简单线性回归方法等价地得到
`\(\widehat{\theta}\)`的对应估计值：

`$$\begin{align}
Y=\beta_{0}+\beta_{1} X+\beta_{3}(X-c) D+\theta D+e
\end{align}$$`

- 简单地，上述等价模型需要进行样本数据集的重新定义。具体地，**运行变量**
`\(X\)`的范围需要调整到
`\(X\in [c-h^{\ast}, c+h^{\ast}]\)`，其中
`\(h^{\ast}=\sqrt{3}h=\sqrt{3}\times 8=13.86\)`

### 2.5 协变量RDD：基本问题

- 回顾**断点处置效应**定理：

&gt; 给定处置分配规则为
`\(D=1\{X \geq c\}\)`，而且假定结果变量满足断点处的连续性假设，也即结果变量的条件期望函数
`\(m(x)\)`在断点处
`\(x=c\)`连续，那么**断点处置效应**为：

`$$\bar{\theta}=m(c+)-m(c-)$$`

.fyi[

- 根据前面的讨论，就效应**估计**和**推断**而言，RDD分析中完全没有必要引入其他协变量（
`\(Z\)`）进入模型。

- 当然，为了提高模型预测**准确度**，我们可以引入一些额外的、有价值的协变量。

]

---

### 2.5 协变量RDD：符号表达

- 给定变量集为：
`\((Y,X,Z)\)`，其中
`\(Z\)`为含有
`\(k\)`个元素的协变量向量（covariates vector）

- 同前，
`\(Y_0\)`和
`\(Y_1\)`分别为**控制条件**和**处置条件**下的**结果变量**（观测的或反事实的）

- 并进一步假定条件期望函数CEF是如下的**线性形式**，且断点两边的方程中协变量系数是相同的
`\(\beta^{\prime}\)`：

`$$\begin{align}
&amp;\mathbb{E}\left[Y_{0} \mid X=x, Z=z\right]=m_{0}(x)+\beta^{\prime} z \\
&amp;\mathbb{E}\left[Y_{1} \mid X=x, Z=z\right]=m_{1}(x)+\beta^{\prime} z
\end{align}$$`

- 那么，结果变量
`\(Y\)`的条件期望函数CEF将可以表达为：

`$$\begin{align}
m(x, z)=m_{0}(x) \cdot \mathbb{1}\{x&lt; c\}+m_{1}(x) \cdot \mathbb{1}\{x \geq c\}+\beta^{\prime} z 
\end{align}$$`

- 此时，可以证明**断点处置效应**结果为：

`$$\overline{\theta} = m(c+,z) - m(c-,z)$$`

---

### 2.5 协变量RDD：估计方法

RDD协变量估计方法有很多种，这里重点讨论([Robinson, 1988](#bib-robinson1988))提出了一种**半参数效率**估计方法，主要步骤如下：

- **步骤1**：直接采用前面的RDD局部线性回归方法（RDD LLR），用
`\(Y_i\)`对
`\(X_i\)`进行回归，并得到第1阶段的**结果变量**的拟合值
`\(\widehat{m}_i = \widehat{m}_i(X_i)\)`

- **步骤2**：依次做
`\(Z_{i1}\)`对
`\(X_i\)`、
`\(Z_{i2}\)`对
`\(X_i\)`、
`\(\ldots\)`的局部线性回归Z（LL），并分别得到**协变量**的拟合值
`\(\widehat{g}_{1i},\widehat{g}_{2i},\ldots,\widehat{g}_{ki}\)`

- **步骤3**：做
`\(Y_i -m_{i}\)`对
`\(Z_{i1}-\widehat{g}_{1i},Z_{i2}-\widehat{g}_{2i},\ldots,Z_{ik}-\widehat{g}_{ki}\)`的回归，并得到**估计系数**
`\(\hat{\beta}\)`及其**标准误**

- **步骤4**：构造残差
`\(\hat{e}_i=Y_i - Z^{\prime}_i\hat{\beta}\)`

- **步骤5**：再次采用RDD局部线性回归方法（LLR），进行
`\(\hat{e}_i\)`对
`\(X_i\)`的回归，并计算得到非参数估计量
`\(\widehat{m}(x)\)`，断点效应估计值
`\(\hat{\theta}\)`及其标准误。

### （死亡率案例）协变量RDD：第3阶段OLS估计(模型)

- **步骤3**：利用前面两个阶段的残差，做
`\(Y_i -m_{i}\)`对
`\(Z_{i1}-\widehat{g}_{1i},Z_{i2}-\widehat{g}_{2i},\ldots,Z_{ik}-\widehat{g}_{ki}\)`的**无截距**的普通最小二乘回归（OLS），并得到**估计系数**
`\(\hat{\beta}\)`及其**标准误**

`$$\begin{align}
(Y_i -m_{i}) &amp;= \hat{\beta}_1(Z_{ia}-\widehat{g}_{1i})+\hat{\beta}_2(Z_{ib}-\widehat{g}_{2i})\\
e&amp;=\hat{\beta}_{1}R_a + \hat{\beta}_{2}R_a 
\end{align}$$`

### （死亡率案例）协变量RDD：断点处置效应

- 根据**断点处置效应定理**，可以得到在断点
`\(x=c=59.1984\)`处对总体平均处置效应
`\(\bar{\theta}\)`的样本估计结果
`\(\hat{\theta}\)`：

`$$\begin{align}
\widehat{\theta}
&amp;=\left[\boldsymbol{\widehat{\beta}_{1}}(c)\right]_{1}-\left[\boldsymbol{\widehat{\beta}_{0}}(c)\right]_{1}\\
&amp;=\hat{m}(c+)-\widehat{m}(c-)\\
&amp;= 2.8209 - 1.2592
= -1.5617
\end{align}$$`



- 断点处置效应估计值为
`\(\hat{\theta}=-1.5617\)`。

.small[
&gt; 
- 断点左边的条件期望(CEF)的估计值
`\(\widehat{m}(c-)=2.8209\)`；
- 断点右边的条件期望(CEF)的估计值
`\(\widehat{m}(c+)=1.2592\)`；

]

- **结论**：援助项目的实施，减低了儿童死亡率，使得10万个孩子中约-1.5617个小孩免于遭受死亡。相比不实施项目援助，儿童死亡率由2.8209，下降到1.2592，降幅接近50%。

---

### （死亡率案例）协变量RDD：估计误差及显著性检验

- 进一步地，估计系数
`\(\hat{\theta}\)`的**渐进方差**为两个方差协方差矩阵第一个对角元素之和：

`$$\begin{align}
\text{Var}{(\hat{\theta})}
&amp;=\left[\widehat{\boldsymbol{V}}_{0}\right]_{11}+\left[\widehat{\boldsymbol{V}}_{1}\right]_{11}\\
&amp;= 0.3673 + 0.1417
= 0.5090\\
se({(\hat{\theta})}) &amp;= \sqrt{\text{Var}{(\hat{\theta})}}
= \sqrt{0.5090}
=0.7122
\end{align}$$`

- 因此RDD断点处置效应估计值
`\(\hat{\theta}\)`的**标准误**为
`\(se({\hat{\theta}}) =0.7122\)`；最后我们可以计算得到**RDD断点处置效应**对应的t统计量：
`\(t^{\ast}=\frac{\hat{\theta}}{se(\hat{\theta})}=-2.19\)`，其概率值为
`\(p=0.0283\)`.

- 综上，RDD结果表明援助项目降低了儿童死亡率，使得10万个孩子中约1.51个小孩免于遭受死亡。并且t统计量检验表明，援助项目在降低了儿童死亡率上具有统计显著性（置信度超过95%）。

### 3.1 模糊RDD分析


**模糊RDD**（fuzzy regression discontinuity design,FRDD）：是指处置条件的条件分配概率在断点处是不连续的（跳跃的），但又不是从0直接跳跃到1的一种RDD分析情形。

&gt; **骤变RDD**中，在断点两边，处置条件的条件分配概率在断点处是跳跃的，而且是直接从0跳跃到1。

- 我们定义处置条件的**条件分配概率**为：

`$$p(x) = \mathbb{P}[D=1|X=x]$$`

- 那么在断点
`\(x=c\)`左右两边的极限**条件分配概率**则分别定义为：
`\(p(c-),p(c+)\)`。

- 因此，对于**模糊RDD**而言，则意味着：
`\(p(c-)\neq p(c+)\)`

### 3.1 模糊RDD分析：断点ATE定理（表达）

.fyi[

**定理**：模糊RDD下的断点处置效应ATE。

- 假定
`\(m_0(x)\)`和
`\(m_1(x)\)`在点
`\(x=c\)`处连续，
`\(p(x)\)`在点
`\(x=c\)`处不连续，且
在断点附近处置变量
`\(D\)`与真实参数
`\(\theta|X\)`相互独立，则断点处置效应ATE为：

`$$\begin{align}
\bar{\theta}=\frac{m(c+)-m(c-)}{p(c+)-p(c-)}
\end{align}$$`

]

---

### 3.1 模糊RDD分析：断点ATE定理（证明）

此时，我们考虑如下的模型：

`$$\begin{align}
\begin{aligned}
Y &amp;=Y_{0} \mathbb{1}\{D=0\}+Y_{1} \mathbb{1}\{D=1\} \\
&amp;=Y_{0}+\theta \mathbb{1}\{D=1\}
\end{aligned}
\end{align}$$`

- 对两边在
`\(x=c\)`附近同时取期望：

`$$\begin{align}
\begin{aligned}
m(x) =m_{0}(x)+\mathbb{E}[\theta \mathbb{1}\{D=1\} \mid X=x] 
=m_{0}(x)+\theta(x) p(x)
\end{aligned}
\end{align}$$`

- 在
`\(x=c\)`处取极限，则有：

`$$\begin{align}
m(c+)=m_{0}(c)+\bar{\theta} p(c+); \quad \quad 
m(c-)=m_{0}(c)+\bar{\theta} p(c-) \\
\end{align}$$`

- 最后可以证明：

`$$\begin{align}
m(c+)- m(c-) = \bar{\theta} p(c+) -\bar{\theta} p(c-) 
\Rightarrow \quad  \quad
\bar{\theta} = \frac{m(c+)- m(c-)}{ p(c+) -  p(c-) }
\end{align}$$`

---

### 3.1 模糊RDD分析：断点ATE的估计（精简表达法）


- 对于分母部分，我们可以使用前面介绍的局部线性回归（LLR）对总体参数
`\(m(c+)- m(c-)\)`进行估计，得到断点
`\(x=c\)`附近的两边的估计值：

`$$\begin{align}
\widehat{m}(c+)- \widehat{m}(c-) 
&amp; \equiv [\widehat{\beta}_1(c)]_1 - [\widehat{\beta}_0(c)]_1
\end{align}$$`

- 同理，分子部分我们也同样使用局部线性回归（LLR）对总体参数
`\(p(c+)- p(c-)\)`进行估计，得到断点
`\(x=c\)`附近的估计值：

`$$\begin{align}
\widehat{p}(c+)- \widehat{p}(c-) 
&amp; \equiv [\widehat{\alpha}_1(c)]_1 - [\widehat{\alpha}_0(c)]_1
\end{align}$$`

- 最终，我们可以得到断点ATE的估计值为：

`$$\begin{align}
\widehat{\theta} &amp;= \frac{\widehat{m}(c+)- \widehat{m}(c-)}{ \widehat{p}(c+) -  \widehat{p}(c-) }
\end{align}$$`

---

### 3.1 模糊RDD分析：断点ATE的估计（精简表达法）

对于模糊RDD断点ATE的估计：

`$$\begin{align}
\widehat{\theta} &amp;= \frac{\widehat{m}(c+)- \widehat{m}(c-)}{ \widehat{p}(c+) -  \widehat{p}(c-) }
\end{align}$$`

- 上式实际上是两类断点估计的比率值。而且当
`\(\widehat{p}(c+) -  \widehat{p}(c-) =1\)`时，以上估计式即为**骤变RDD**的估计情形！

- 上述估计值的计算总共会需要进行4次**局部线性回归**，是不是需要都使用相同的**谱宽**（bandwidth），或者断点两侧是否要采用不同数量的**箱组**（bins），可以进行多次尝试！

---

### 3.1 模糊RDD分析：断点ATE的估计（IV表达法）

事实上，上述模糊RDD断点ATE的估计可以使用**工具变量法**（IV）等价得到。

- 简单地，可以把
`\(D\)`视作为
`\(X\)`的工具变量，然后把
`\(Y\)`对它们二者进行**局部加权工具变量估计**（Locally weighted IV estimation），从而得到断点ATE估计值
`\(\widehat{\theta}\)`。

- 断点处置效应能否被识别，有赖于在断点附近处概率
`\(p(x)\)`的跳跃性程度。如果跳跃不大，那么就会带来**弱工具变量**问题（Weak Instruments Problem）。

- ATE估计的标准误，其计算过程类似于IV回归法。我们先把估计量
`\({\widehat{m}(c+)- \widehat{m}(c-)}\)`的标准误定义为
`\(s(\widehat{\theta})\)`，那么就可以使用下式计算得到ATE估计
`\(\widehat{\theta}\)`的标准误：

`$$\begin{align}
s(ate)=\frac{s(\widehat{\theta})}{|\hat{p}(c+)-\widehat{p}(c-)|}
\end{align}$$`

### 3.2 拐点回归RKD分析：问题描述

**拐点回归设计**（Regression Kink Design, RKD）：是探讨**结果变量**
`\(Y\)`对**运行变量**
`\(X\)`的**斜率**（slope）是否存在显著改变（change）的一种处置效应回归分析设计框架。

- 处置条件只是改变了**斜率**，但是并没有引起结果变量的跳跃，也即结果变量在**拐点处**（kink point）还是连续的！

- 在有些情形下，研究者还可以关注**处置水平**D对**运行变量**X的变化率的**拐点效应**。

---

**案例1**：政府择机扶持科技公司。

- 政府在特定时间点开始，决定大量关注并投资科技公司。此时公司雇员人数为**结果变量**Y，时间观测为**运行变量**X，政府是否决定大量投资则为**处置变量**D。

- 这种情况下，公司雇员总人数Y可能并不会在**拐点**
`\(x=c\)`处立刻跳跃（不连续），但是我们预期在**拐点后**的公司的雇员增长率（Y对X的斜率）会比之前会有一个明显变化！

]

`\(Y\)`对**运行变量**

]

- **结果变量**
`\(Y\)`对**运行变量**

- 显然，在拐点之后（最高补贴之后），**等待时长**Y对正常**工作收入**X的比率应该会变得比拐点之前更加平缓（斜率更小）！——也即出现了Y对X的斜率具有**拐点效应**！同时，我们还可以预期到就业**等待时长**Y并不会在**拐点**

### 3.3 多断点RDD：引子

.fyi[
**回顾与思考**：

- 截止目前为止，我们已经接触了骤变断点（SRDD）、模糊断点（FRDD）、斜率改变拐点（RKD）

- 那么，我们能不能考虑政策存在多个断点（或拐点）的情形呢？


]


---

###（示例）多断点RDD应用案例

.case[

**应用案例**：

- 在**育儿支持案例**中，能拿到**最高**补贴支持的**家庭季度收入**（x=c），也是随着年度变化而进行调整的。例如在2004年这个收入水平划定为25000美元，而到了2005年则被划定在20000美元。

- 一国猪肉储备投放政策中，会考虑根据猪粮比价（X）变动，分别设定红色、橙色、蓝色和绿色预警窗口（多个断点），来决定如何干预市场（如生产收储或市场投放，以及数量多少等）。

]


---

###（示例）多断点RDD应用案例

.case[

**应用案例**（续）：

- 高考招生政策中，会考虑根据不同招生类型（如普通招录生、师范特招生、体育特招生等），设定不同的高考成绩录取线（多个断点）。而且普通高考招录的录取线，对于不同的省份也是不同的（例如，某省的某个高校在全国各省的招录录取线就会各不相同——一般本省录取线会更低）。

- 在多党派多家的政党选举中，某个政党能否竞选胜出执政，有的年度可能需要50.1%的投票率，但是有的年份可能只需要42.7%就能胜选。

]

### 3.3 多断点RDD：问题描述

- 很多情况下，**断点**（或拐点）本身就是政策指定者最为关注的议题

- 一些情形下，**多个断点**的政策设计具有很强的现实意义或价值。

**多断点分析**（Cutoffs cut off Analysis）：在运行变量X上，存在多个**断点**，断点值的划定，往往基于不同群体、不同地区，或不同时间段上的运行变量取值。



---

### 3.3 多断点RDD：断点ATE的估计

.fyi[
**回顾与启发**：

- 在经典的RDD估计中，**断点平均处置效应**（ATE）是把断点附近的处置效应做了简单平均（正如其名！）。

- 但是，在**多断点**的RDD情形下，事情变得复杂（不同的断点针对不同的群体），因此不能再直接、粗暴地进行**简单平均**——我们必须考虑到不同的群体区块！

]

- 多断点RDD估计时，可以使用函数`rdmulti::rdmc()`进行分析

### 3.4 安慰剂检验：原理

**安慰剂检验**（Placebo Tests）：RDD分析的前提假设是，处置变量的作用是“干净的”、没有后门的（no back doors）。如果不使用结果变量Y，而是使用**协变量**作为“结果变量”进行正常的RDD估计，如果也表现出与之前同样显著的断点处置效应ATE，那么我们就要质疑我们的RDD设计框架了。

- 选择合理的协变量，将其视作为“结果变量”

- 进行常规的RDD分析流程

- 比较结果并得出检验结论。

&gt; 理论上，上述操作不应该得到——**“显著存在断点处置效应”**——的结论！

---
